import React from 'react'

export const Footer = () => {
  return (
    <div className="grid grid-cols-6 bg-black text-white">
        <div className="place-self-center p-2">1</div>
        <div className="place-self-center p-2">2</div>
        <div className="place-self-center p-2">3</div>
        <div className="place-self-center p-2">4</div>
        <div className="place-self-center p-2">5</div>
        <div className="place-self-center p-2">6</div>
    </div>
  )
}
